import React from "react";

const Main = ({ personas }) => {
  console.log(personas);
  return (
    <>
      <main>
        {personas.map((persona) => (
          <ul>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        ))}{" "}
      </main>
    </>
  );
};

export default Main;
